package javaclass;

public class whileex {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,num=5,res;
		i=1;
		System.out.println("Multiplication table using while loop");
		while(i<=10)
		{
			res=i*num;
			System.out.println("The multiplication of 5 is: "+res);
			i=i+1;
			
		}
	}

}
